import React from 'react';


function News() {

    const fetchNews = async () => {
        const token = 'a05805ed58ffc71ae2f0a4ea2d84ab25';
        const newsURL = `https://gnews.io/api/v3/top-news?lang=pl&max=5&token=${token}`;

        const fetchData = await fetch(newsURL);
        const data = await fetchData.json();

        console.log(data);
    }

    fetchNews();
    return (
        <h1>News</h1>
    );
}

export default News;
